css:
@-moz-document domain("actmedia.eu") {
body {background: #292929 !Important;}
h1, h2, .h1_replacement {color:#eaeaea !important;}
#extra-nav a {background-color: #292929 !Important;color: #ABABAB !important;}
#primary-nav {background: #393939 !Important;border-bottom: 1px solid #656565 !important;}
#primary-nav li a.on {background: #393939 !Important;    border-bottom: 1px solid #656565 !important;}
#nav-two {    background-color: #545454 !important;}
.local_date {    color: #C5C5C5 !important;}
div.box h3 a {    color: #ECECEC !important;}
#primary-column p, #feature-column p {color: #ECECEC !important;}
#secondary-column {border-left: 1px solid #656565 !important;}
#secondary-column .other li {background-color: #393939 !Important;}
#secondary-column .other li a {    color: #B9B9B9 !important;}
p {    color: #DCDCDC !important;}
#search-form li.field input#site-search-input {background: #353535 !important;    color: #BFBFBF !Important; border-color:#656565 !important;}
#mid h3 {background: #393939 !Important;}
#mid {border-top: 1px solid #656565 !important;}
#mid h3 {border-right:none !Important;}
#primary-single .article-info {border-bottom: 1px solid #656565 !important;}
a {color:#fff !important;}
* { color: #C7C7C7 !important;}
#secondary-column strong, div.box-more strong {    background-color: #545454 !important;}
}
